use alloy::hex;
use beacon_api_types::Mainnet;
use cosmwasm_std::{
    testing::{mock_dependencies, mock_env},
    Addr, Timestamp,
};
use ethereum_light_client_types::{ClientState, ConsensusState, Header};
use ibc_union_light_client::IbcClientCtx;
use unionlabs::encoding::{Bincode, DecodeAs, EthAbi};

use crate::client::verify_header;

#[test]
fn verify_header_works() {
    let deps = mock_dependencies();
    let mut env = mock_env();
    env.block.time = Timestamp::from_seconds(1733949552);
    let ctx = IbcClientCtx::new(2, Addr::unchecked(""), deps.as_ref(), env);

    let client_state = ClientState::decode_as::<Bincode>(&hex::decode("").unwrap()).unwrap();
    let consensus_state = ConsensusState::decode_as::<EthAbi>(&hex::decode("").unwrap()).unwrap();
    let header = Header::decode_as::<Bincode>(&hex::decode("").unwrap()).unwrap();

    verify_header::<Mainnet>(&ctx, client_state, consensus_state, header).unwrap();
}
